import React from 'react';

const Menu = () => {
  return (
    
    <div className="container-menu">
      <div>Greek Salad</div>
      <div>Pizza Margherita</div>
      <div>Moroccan Tagine</div>
      <div>Moussaka</div>
      <div>Bruschetta</div>
      <div>Tabouli</div>
      <div>Shakshuka</div>
      <div>Falafel</div>
      <div>Lemon Meringue Tart</div>
    </div>
  )
}

export default Menu;
